export const getCartData = async () => {
  let data = []
  try {
    const res = await fetch("http://localhost:8085/food", {
      headers: {
        'Cache-Control': 'no-cache',
        'Pragma': 'no-cache',
        'Content-Type': 'application/json'
      },
    })
  }
  catch (error) {
    console.log(error)
  }
  return data
}
